import SearchBar from '../SearchBar';
import SearchResults from '../SearchResults';

const SearchPage = () => {

  const [results, setResults] = useState([]);

  return (
    <div>
      <div>
        <SearchBar />
      </div>
      <div>
        <SearchResults results={results}/>
      </div>
    </div>
  );
};

export default SearchPage;
